INSERT INTO `products` (`id`, `name`, `description`, `details`, `purchase_price`, `price`, `old_price`, `qte`, `photo`, `imag_one`, `imag_two`, `category_id`, `created_at`, `updated_at`) VALUES
(1, 'espadrie', 'mode femme blanc en matière cuir', 'ok', 21.00, 154.00, 120.00, 30, '65c93977d0144.jpg', '661fd7b2eaba4.jpg', '661fd7b2eb5b5.jpg', 1, '2024-02-11 20:17:32', '2024-05-19 09:34:12'),
(3, 'Swatch Montre Mixte', 'La montre est la finalité du look; Un allié de chaque jour, Plus qu’un simple instrument de mesure du temps, la montre est un véritable accessoire de mode et un symbole d\'élégance pour tous. Quelle que soit sa forme et son style, cet indispensable intemporel accessoirise une tenue quotidienne et révèle votre style. Un cadeau tout à fait spécial et idéal pour les fêtes, la Saint Valentin, Noël, l\'anniversaire, la remise des diplômes, etc.. Cet montre Originale résiste a l\'eau et la poussière dans les normes européenne.', 'GN414 - Bleu - Garantie 2', 180.00, 212.00, 235.00, 20, '665c5d9876e76.jpg', '665c5d9877b06.jpg', '665c5d987872c.jpg', 3, '2024-02-12 08:13:22', '2024-06-02 10:55:04'),
(4, 'montre classique', 'La montre est la finalité du look; Un allié de chaque jour, plus qu’un simple instrument de mesure du temps, la montre est un véritable accessoire de mode et un symbole d\'élégance pour tous  Quelle que soit sa forme et son style, cet indispensable intemporel accessoirise une tenue quotidienne et révèle votre style.Cette montre pour homme est Tout en acier inoxydable solide avec magnétique verrouillage fermoir', 'Montre Bracelet magnétique fabriqué avec un maillage en acier inoxydable flexible et une conception solide de fermoir magnétique permettant un ajustement personnalisé pour obtenir un ajustement parfait.\r\n Couleur Argent\r\nCadran Blanc \r\nBracelet :  Argent\r\nLargeur du bracelet (mm) : 22\r\nDimensions (mm) :50\r\nCette montre pour homme est tout en acier inoxydable solide treillis métallique avec magnétique verrouillage fermoir\r\nCadeaux parfaits : Adaptée à toutes les occasions.', 58.00, 120.00, 150.00, 6571, '65ca458760f2a.jpg', '665c5fe71fbe4.jpeg', '665c5fe721374.jpeg', 3, '2024-02-12 15:21:27', '2024-06-02 11:05:37'),
(5, 'lunette', 'Les Lunettes sont un accessoire à la mode d\'un type très spécial. Il est inutile de dire qu\'elles doivent protéger de manière fiable vos yeux des éblouissements et des radiations UV nuisibles. Mais elles doivent également être fun à porter. Elles reflètent votre style personnel et votre personnalité et pas uniquement quand le soleil brille !', '- Attribut Optique des Lentilles : Anti-reflet\r\n - Matériau de Cadre : En plastique \r\n- Matériau de Verres : Acrylique\r\n - Hauteur lentille : 49mm\r\n - Largeur lentille : 58mm', 145.00, 180.00, 220.00, 80, '65ca45dcad85d.jpg', '665c637899e92.jpg', '665c63789ad61.jpg', 3, '2024-02-12 15:22:52', '2024-06-02 11:20:08'),
(6, 'casquette', 'Casquette homme hmlHIVE JASON CAP est construit dans un style à 6 panneaux en utilisant 100% de coton biologique, qui est produit avec moins d\'eau et sans produits chimiques nocifs. Cette casquette hummel® présente un logo brodé contrastant sur le devant.', 'Hummel Casquette Homme', 50.00, 60.00, 90.00, 24, '665c65ca2e62a.jpg', '665c65ca2fbe6.jpg', '665c65ca30989.jpg', 1, '2024-02-12 15:23:58', '2024-06-02 11:30:20'),
(7, 'Nike Basket', 'La marque a assuré sa notoriété par un logo simple et rapidement reconnaissable : le Swoosh, une virgule posée à l\'envers et à l\'horizontale ; il a été créé par Carolyn Davidson en 1971 comme une représentation stylisée de l\'aile de la déesse.\r\n\r\nEn 2005, Nike réalise 55 % de ses ventes à l\'étranger6. L\'entreprise est actuellement le plus grand équipementier sportif dans le monde avec un chiffre d\'affaires de 32,4 milliards de dollars, devant Adidas qui fut le leader incontesté pendant 50 ans7.', 'Nike Basket Court Vision Lo Nn - DH2987-001', 300.00, 320.00, 400.00, 500, '665c670229881.jpg', '665c67022b3ea.jpg', '665c67022c527.jpg', 1, '2024-02-12 15:24:53', '2024-06-02 11:35:14'),
(9, 'Pantalon Homme', 'Pantalon Homme-Chino- imprimé- Marine - 810514 H23Vous cherchez un pantalon Chino à la mode et chic à la fois  sans avoir d’idées très arrêtées sur ce que vous souhaitez ou, au contraire, vous savez très bien ce que vous voulez ? ETRE EXCLUSIF est la solution pour toute vos demandes, Notre Boutique vous gâte avec des Nouvelles Collections contenant une vaste gamme de pantalons Chino, parmi les On trouve Ce pantalon homme de Couleur Marine imprimé d\'un micro motif fantaisie, de taille Haute est d\'une très belle fashion Coupe Slim . Ce Pantalon chino ajusté faux uni à 4 poches. Coupe ajustée. Longueur pied. Fermeture boutonnée avec zip. deux poches italiennes devant. deux poches passepoilées à boutons au dos. Motifs micro-pois effet faux-uni. Tissu Oxford. Couture de renfort sur les poches. deux petites pinces au dos. Boutons gravés ton sur ton. Passants pour ceinture.  Pour ceux qui cherchent la mode et le confort en même temps, c\'est la pièce idéale et parfaite pour le travail   Bureautique , ou pour une occasion de fête … grâce a sa composition qui offre assez de confort tout au long de la journée. N\'hésite plus pour le commander.', 'Etre exclusif Pantalon Homme-Chino- imprimé- Marine - 810514 H23', 80.00, 100.00, 170.00, 49, '665c67c0c6107.jpg', '665c67c0c6bc3.jpg', '665c67c0c74af.jpg', 1, '2024-02-12 21:54:31', '2024-06-02 16:09:53'),
(10, 'montre connecté', 'Montre Connectée KAKU KSC-766 - Écran: 1.28\" - Système d’exploitation: Android et iOS - Connectivité: Bluetooth - Batterie: 250 mAh - Matière bracelet: Silicone - Résistant à l\'eau IP68- Le KAKU KSC-766 fournit un suivi sportif : 13 modes d\'exercice, suivi d\'activité de toute la journée, chronomètre, rapport de données sportives - Santé: Prise en charge de la détection de la fréquence cardiaque, du sang détection de pression, détection d\'oxygène dans le sang - Recevez des notifications de Smartphone, réveil, météo, contrôle de la caméra, contrôle de la musique, langue de police complète - Couleur: Noir - Garantie: 1 an', 'PARTAGEZ CE PRODUIT\r\n\r\n\r\nKakusiga Montre Connecté KAKU KSC-766 - NOIR', 190.00, 200.00, 220.00, 30, '65caa1d913bf2.jpg', '665c688a1d385.jpg', '665c688a1e1a2.jpg', 3, '2024-02-12 21:55:21', '2024-06-02 11:41:46'),
(11, 'veste', 'Cette veste est un véritable chef-d\'œuvre de durabilité et de confort. Fabriquée en cuir synthétique, elle est rembourrée pour vous offrir une chaleur et un confort supplémentaires. Conçue pour résister aux rigueurs de la vie quotidienne, elle est robuste, solide et résistante. Contrairement à d\'autres matériaux similaires, cette veste ne se décolle pas, ce qui garantit sa longévité.\r\nLe cuir synthétique utilisé pour cette veste est durable et résistant, tout en conservant une souplesse qui assure une liberté de mouvement optimale. Vous pouvez être sûr que cette veste vous accompagnera pendant de nombreuses années, vieillissant avec vous et devenant une véritable armure pour affronter tous les défis de la vie. Elle est non seulement élégante, mais aussi fonctionnelle, offrant une protection contre les intempéries et une grande polyvalence pour votre style.', 'PARTAGEZ CE PRODUIT\r\n\r\n\r\nVeste cuir rembourrée homme -Noir - Réf : 1588-N', 170.00, 250.00, 360.00, 11, '65caa1fb8fb6b.jpg', '665c694dc9fe5.jpg', '665c694dcab64.jpg', 1, '2024-02-12 21:55:55', '2024-06-02 11:45:01'),
(12, 'Tablette d\'écriture', 'Cette tablette à dessin vous apporte une expérience de vie plus pratique et artistique, est le cadeau parfait pour les enfants.\r\nL\'écran LCD supérieur sensible à la pression 0\r\nvous apporter une meilleure expérience que le dessin sur papier,peut laisser les enfants afficher leur imagination incomparable.\r\nLe graffiti est l\'activité la plus efficace pour le développement du cerveau.', 'Kids Tablets Tablette d\'écriture créative LCD 8.5 Pouces - Jouet éducatif pour Enfant - Rose', 120.00, 180.00, 200.00, 60, '665c6afe4da2c.jpg', '665c6a2b71fbc.jpg', '665c6a2b72975.jpg', 3, '2024-02-12 21:56:49', '2024-06-02 11:52:14'),
(13, 'plaque cuissante', 'Avec une cuisine équipée, on rêve d’appareils électroménagers encastrés. Rien de tel en effet que ces éléments qui s’installent discrètement au sein du plan de travail et du mobilier de la cuisine Contrairement aux modèles pose libre.\r\nLa plaque f.401X Inox 60 CM , contient 4 brûleurs à gaz , une Flamme stabilisée , des Grilles et chapeaux de brûleurs émaillées, une Allumage automatique et des Commandes frontales.\r\nSa Garantie est de de  2 Ans.', 'Focus Plaque - 4 Feux - Inox - F.401X - Garantie 2 ans', 300.00, 320.00, 450.00, 60, '665f568261c88.jpg', '665f56826237d.jpg', '665f5682627b6.jpg', 4, '2024-02-13 07:27:50', '2024-06-04 17:01:38'),
(14, 'machine a laver', 'Le lave-linge frontal ARISTON incarne l\'excellence en matière de performance, d\'efficacité énergétique et de praticité, offrant une solution de lavage haut de gamme pour répondre à tous vos besoins domestiques, tout en vous permettant de réaliser des économies d\'eau et d\'énergie.Avec une capacité généreuse de 8 kg, ce lave-linge vous offre la possibilité de laver de grandes charges de linge en une seule fois, ce qui est parfait pour les familles nombreuses ou pour ceux qui ont une quantité importante de linge à traiter régulièrement.Doté d\'une vitesse de rotation de 1200 tours par minute, ce lave-linge assure un essorage efficace, permettant à votre linge de ressortir plus sec, réduisant ainsi le temps de séchage et vous offrant des résultats impeccables plus rapidement.Classé A+++ en termes d\'efficacité énergétique, ce lave-linge est conçu pour minimiser votre consommation d\'électricité, vous permettant ainsi de réaliser des économies sur vos factures d\'énergie tout en contribuant à la préservation de l\'environnement.Avec 16 programmes de lavage différents, ce lave-linge offre une polyvalence exceptionnelle pour répondre à tous vos besoins de lavage, que ce soit pour les tissus délicats, les vêtements de sport ou les textiles de maison.Le moteur inverter garantit des performances fiables et silencieuses, tandis que l\'affichage numérique facilite la sélection des programmes et le suivi du cycle de lavage.Avec des niveaux sonores de lavage de 54 dB et d\'essorage de 78 dB, ce lave-linge assure un fonctionnement silencieux, vous permettant de vaquer à vos occupations quotidiennes sans être dérangé par le bruit de l\'appareil.Avec des dimensions compactes de 85 x 59,5 x 60 cm et une finition élégante en gris graphite et argent, ce lave-linge s\'intègre harmonieusement dans n\'importe quel espace de vie, ajoutant une touche de style moderne à votre buanderie ou à votre salle de bain.Fabriqué en Pologne avec des normes de qualité strictes, ce lave-linge est conçu pour offrir des performances durables et fiables, et est soutenu par une garantie de 3 ans pour une tranquillité d\'esprit supplémentaire.En résumé, le lave-linge frontal ARISTON combine des performances exceptionnelles, une efficacité énergétique optimale et une praticité inégalée pour vous offrir une expérience de lavage sans effort et des résultats impeccables à chaque utilisation.', 'Ariston Machine A Laver -8KG-1200Tr-16 Prog -Silver- Inverter- NS823CGGMA-Garantie 3Ans', 1000.00, 1200.00, 1320.00, 8, '665f572755838.jpg', '665f572755fb2.jpg', '665f57275653b.jpg', 4, '2024-02-13 07:28:54', '2024-06-04 17:04:23'),
(15, 'pantalon bleu', 'Pantalon de ville - Homme - 8158 E20 - Bleu 65% polyester - 35 % coton Vous cherchez un pantalon de ville sans avoir d’idées très arrêtées sur ce que vous souhaitez ou, au contraire, vous savez très bien ce que vous voulez ? ETRE EXCLUSIF Qui propose une vaste gamme de pantalons de ville sur mesure.Le pantalon de ville homme est le grand classique des tenues élégantes sans trop en faire. Plus habillé qu’un jean ou qu’un chino, le pantalon de ville est la pièce idéale pour une tenue smart casual. Vous pouvez en effet le porter à la maison, au bureau, à des soirées en terrasses ou des dîners en ville, avec une chemise, un polo ou un tee-shirt.', 'Etre exclusif Pantalon de ville - Homme - 8158 E20 - Bleu', 100.00, 118.00, 124.00, 998, '665f57c8368e0.jpg', '665f57c836eec.jpg', '665f57c837294.jpg', 1, '2024-02-18 08:30:58', '2024-06-04 17:07:04'),
(16, 'Doudoune', 'Doudoune bébé imprimé, avec capuche et fermeture éclair\r\n\r\nDoudoune unisexe pour bébé àgé 12 mois.', 'Mdm Doudoune bébé imprimé avec capuche - 12 Mois Jaune', 20.00, 56.00, 60.00, 60, '65d9c3f662c6d.jpg', '665f581458b26.jpg', '665f5814591c9.jpg', 1, '2024-02-24 09:24:54', '2024-06-04 17:09:16'),
(17, 'bonnet', 'Bonnet et Cache cou - Fille - Bleu - 4985 H20 le bonnet thermique et le foulard sont superposés, ce qui permet une meilleure rétention de la chaleur, en tirant de manière élastique pour couvrir les oreilles, le visage et le cou des enfants, tout en les gardant au chaud.', 'Etre exclusif Bonnet et Cache cou - Fille bébé - Bleu - 4985 H20', 40.00, 42.00, 48.00, 62, '65d9c45982b13.jpg', '665f58c50034e.jpg', '665f58c500953.jpg', 1, '2024-02-24 09:26:33', '2024-06-04 17:11:17'),
(18, 'hoco support', 'Support de table HOCO PH34 Fabriqué en ABS, acier au carbone et silicone, le manche est extrêmement durable et résistant aux dommages. La rotation   vous permet d\'ajuster la position de l\'appareil à vos besoins. Support de bureau pliable PH34 Excellente pour téléphones portables et tablettes PC de 4,7 à 13 pouces, pour étude en ligne, bureau, diffusion en direct Matériau : ABS + silicone. Technologie de surface : motif soleil. Tailles : plié 90*125*54mm, déplié 90*125*250mm.Poids : 240gr. compatible avec les téléphones mobiles et les tablettes de 4,7 à 13 pouces. Applicable pour l\'étude en classe en ligne, la réunion de travail, le visionnage de films et de vidéos, la diffusion en direct. Compatibilité super large, conception à double pliage à deux axes, réglage de l\'angle.', 'Hoco Support DESKTOP Ajustable pour Mobile et Tablette PH34 - Blanc', 40.00, 44.00, 50.00, 10, '665f596982c09.jpg', '665f5969836e6.jpg', '665f596983aa2.jpg', 3, '2024-02-24 09:27:37', '2024-06-04 17:14:01'),
(19, 'pullover', 'Pull - Garçon - Marine - 7461 H20 30% LAINE / 70% ACRYLIQURce pull tendance qui vous accompagnera toute la saison automne hiver quelque soit votre style pour bien chauffer votre enfant et résiste contre le froid . il est trop mignon avec une couleur attirent . vous pouvez l\'associer avec des jean et des baskets .c\'est un élément indispensable pour vos petits garçons.                          votre prince est unique avec ce pull adorable à détailles tendance .', 'Pull - Garçon - Marine - 7461 H20', 50.00, 52.00, 60.00, 20, '665f5a3dc5ff1.jpg', '665f5a3dc65c4.jpg', '665f5a3dc6981.jpg', 1, '2024-02-24 09:28:35', '2024-06-04 17:17:33'),
(20, 'veste', 'Notre mission est d\'habiller les gens en fonction de leurs styles et de leurs budgets et les faire se sentir bien sur la base de la mission « Tout le monde mérite d\'être bien habillé ».Et a propos Notre Boutique Être exclusif vous propose ce blouson , unie en Noir Il à  2 poches latérales en bas. Ce produit est fabriqué en tissu 100% polyester et agréable à porter comme un coupe vent, il est déparlant. Pour l’entretien: il se lave en machine avec eau tiède et à l’envers avec les habilles de même couleur, et le repassage est à l’envers avec le mode adapté à sa résistance. Vous pouvez l’associer avec plusieurs choix et styles, il existe en plusieurs coloris et tailles. N\'hésitez pas à le commander.', 'Blouson Homme- Noir - 900020 H24 \"Nouvelle collection \"', 100.00, 160.00, 170.00, 894, '665f6e5f30c93.jpg', '665f6e5f31471.jpg', '665f6e5f31b71.jpg', 1, '2024-02-24 09:29:36', '2024-06-04 18:43:27'),
(21, 'ipad', 'L\'apple iPad 10È Génération dispose d\'un écran Liquid Retina de 10,9 avec une résolution de 2360 x 1640. L\'écran Liquid Retina possède toujours toutes les fonctionnalités que vous attendez, telles que Large gamme de couleurs P3, revêtements oléophobes antireflet et résistants aux traces de doigts, 500 nits de luminosité. L\'écran n\'est pas la seule chose à avoir été améliorée. \r\nL\'apple iPad intègre désormais la puce A14 Bionic, qui offre l\'amélioration des performances dont vous avez besoin pour gérer le montage vidéo 4K, jouer à des jeux immersifs, etc. Il dispose également d\'une capacité de stockage de 64 Go. La puce A14 Bionic offre puissance et performances pour toutes les activités. Montez une vidéo 4K dans iMovie, planifiez des vacances à travers le monde avec des amis ou jouez à un jeu gourmand en graphismes. Avec une autonomie d\'une journée, vous pouvez tout faire sans perdre de temps.\r\n L\'iPad est conçu pour être durable, vous avez donc l\'esprit tranquille en sachant que vous pouvez l\'emporter partout où vous allez. Tourne sous iPadOS 16 qui renforce les performances et la polyvalence de l’iPad avec de nouvelles fonctionnalités de productivité et de collaboration. \r\nLivré avec connecteur USB-C pour la recharge et les accessoires. L’iPad vous offre autonomie d’une journée pour en faire toujours plus3. Avec Wi-Fi6E ultra-rapide et 5G2.\r\n Compatible avec l’Apple Pencil (1ʳᵉ génération)4 et le Magic Keyboard Folio. L\'iPad 10.9 est doté d\'un superbe écran Liquid Retina de 10,9 pouces1 avec TrueTone. Il est équipé d’une appareil photo arrière grand-angle 12Mpx et d\'une caméra avant ultra grand-angle 12Mpx horizontale avec Cadre centré. Profitez de Touch ID pour une authentification sécurisée et ApplePay.', 'Apple IPAD 10,9\" 64 GB - WI-FI + CELLULAR - BLUE - Garantie 12 Mois', 300.00, 320.00, 340.00, 130, '65d9c55c18b5d.jpg', '665f5bacda58a.jpg', '665f5bacda9fe.jpg', 3, '2024-02-24 09:30:52', '2024-06-04 17:23:40'),
(22, 'montre connecté', 'Facile à installer et à utiliser: Le chargeur magnétique est facile à installer et à utiliser.utilisation en toute sécurité: Il est fabriqué en matériau de qualité supérieure, robuste et durable pour une utilisation en toute sécurité. La commodité de l\'alimentation est très appropriée pour une utilisation en intérieur et en extérieur, et elle peut être utilisée dans les gymnases, les bureaux, etc.facilité d\'utilisation: Le connecteur de câble du chargeur a une conception conviviale, qui peut être facilement installé et remplacé sans aucun outil.une efficacité élevée et une facilité d\'utilisation élevées peuvent répondre à vos besoins quotidiens. La commodité de facilité d\'utilisation est notre priorité absolue.plus sûr et stable: La conception du trou de chargement usb est adoptée et la charge peut être rapidement chargée, ce qui le rend plus sûr. Le câble de chargement usb est fait d\'un matériau tressé en fibre métallique, plus sûr et stable.économie d\'énergie: Le câble de charge usb a une économie d\'énergie, une protection contre les surcharges et le courant. Adopter un matériau en silicone de qualité, robuste, durable et économie d\'énergie.sûr et inoffensif: Le connecteur de charge du chargeur usb-c est sûr et inoffensif pour le chargement des téléphones portables, ce qui vous offre une meilleure expérience utilisateur. Le câble de chargement usb a été mis à niveau, sûr et inoffensif, vous pouvez l\'utiliser en toute confiance.hypoallergénique: Le matériau en silicone doux et hypoallergénique assure une charge sûre. La surface en silicone hypoallergénique empêche les bactéries de se développer.câble de charge: Le câble de charge est fabriqué en nylon tressé haute résistance et recouvert d\'un manchon intérieur pour éviter les dommages lors du remplacement de la batterie. Et le câble de charge est en silicone, qui a une bonne flexibilité et durabilité.', 'PARTAGEZ CE PRODUIT\r\n\r\n\r\nGenuine Câble de Charge Magnétique pour Montre Connectée Haylou LS05, RS4, LS12', 100.00, 150.00, 180.00, 6, '665f5c6e41224.jpg', '665f5c6e417ee.jpg', '665f5c6e41b88.jpg', 3, '2024-02-24 09:31:48', '2024-06-04 17:26:54'),
(24, 'Chemise Homme', 'Chemise Homme - Blanc - 830028 E24\r\nL\'habillement est un point très essentiel dans la mise en beauté, il reflète l\'élégance, la charme et surtout l\'épanouissement personnel. Et à cette raison notre boutique Être Exclusif gâte leurs clients avec des Nouvelles collections Été de vêtements pour Hommes. Parmi ces collections, on vous présente cette Tendance Chemise incontournable pour tout amoureux de mode. Elle est de couleur Blanc à coupe ajustée ou semi ajustée : pensée pour s’accorder à toutes les morphologies. Un volume appuyé tout en restant confortable. Ce modèle vous satisfera pleinement. Grâce à sa matière 100 % coton, qui laisse votre peau respirer, vous vous sentirez à l\'aise en l\'habillant. Cette belle chemise est aussi un élément indispensable pour adopter un style élégant et elle n\'est plus perçue comme un vêtement strict et est devenue un véritable atout pour adopter un style classe et Trendy. Un mix entre un jean et une chemise à manches longues homme donne un côté plus Street à votre tenue, surtout si vous portez aux pieds des baskets. Optez pour cette chemise facile à associer avec différents Outfits.', 'Etre exclusif Chemise Homme - Blanc - 830028 E24', 50.00, 74.00, 82.00, 139, '665f76448d53f.jpg', '665f76448dbb3.jpg', '665f76448df98.jpg', 1, '2024-02-24 09:35:53', '2024-06-04 19:17:08'),
(25, 'Qcy Ecouteur', 'Excellente qualité de son (super basse), design sans fil double oreille, séparation du canal d\'oreille gauche et droit. Vous pouvez utiliser le casque seulement, ou les utiliser par paire. BT 5.0 offre une vitesse de transfert de données élevée, une connexion stable et une faible consommation d\'énergie.Le sans fil le plus vrai. Après une configuration simple en un seul geste, les T1C sont automatiquement allumés et toujours connectés. Leur utilisation est tout aussi simple. L\'expérience T1C est tout aussi étonnante, que vous les utilisiez avec votre iPhone ou votre Android.Alimentation intelligente, chargez en cours de route. Restez sous tension où que vous soyez. La mise en marche et l\'arrêt automatiques empêchent la batterie de se décharger grâce à la recharge intelligente dans l\'étui de transport. Ne vous inquiétez pas de l\'autonomie de la batterie, placez simplement vos écouteurs dans l\'étui de transport pour les recharger lors de vos déplacements.', 'Qcy Ecouteur -T1C - Noir', 200.00, 250.00, 280.00, 35, '665f713e8ec4b.jpg', '665f713e8f30a.jpg', '665f713e8f8d8.jpg', 3, '2024-02-24 17:37:06', '2024-06-04 18:55:42'),
(28, 'Doudoune Homme', 'Doudoune Homme avec capuche - ecru - 900022 H24 \"Nouvelle Collection\"Pour combattre le froid d\'hiver, notre mission est d\'habiller les gens en fonction de leurs styles et de leurs budgets et les faire se sentir bien sur la base de la mission « Tout le monde mérite d\'être bien habillé ».Et a propos Notre Boutique Être exclusif vous propose cette Doudoune à capuche de style courte matelassée et de couleur Ecru, cet article contient  un zip pour un système coup vent, elle contient aussi 2 poches une autres latérale passepoilées .Une poche interne aussi, ainsi que sa capuche amovible pour un esprit hivernal où l’enlever pour un look de veste, avec un garnissage en fibre de polyester pour maintenir le chaud. Sa couleur neutre vous permet de l’associer avec plusieurs couleurs, elle existe en plusieurs tailles et pour l’entretien ce modèle se lave à l’envers.N\'hésitez pas à le commander.', 'PARTAGEZ CE PRODUIT\r\n\r\n\r\nEtre exclusif Doudoune Homme avec capuche - Ecru - 900022 H24 \"Nouvelle Collection\"', 50.00, 60.00, 66.00, 7, '665f71f5da160.jpg', '665f71f5da98f.jpg', '665f71f5dae9c.jpg', 1, '2024-02-25 07:14:02', '2024-06-04 18:58:45'),
(29, 'T shirt', 'Le t-shirt \"No Pain No Gain\" est un vêtement de choix pour les personnes passionnées par le fitness et la musculation. Arborant un message puissant, ce t-shirt est un rappel constant que la réussite nécessite des efforts et de la persévérance.\r\n\r\nFabriqué à partir de matériaux de qualité supérieure, ce t-shirt offre un confort optimal pendant l\'entraînement. Avec sa coupe ajustée et ses manches courtes, il met en valeur la silhouette musclée tout en offrant une grande liberté de mouvement.\r\n\r\nLe message \"No Pain No Gain\" est un mantra qui inspire les athlètes à se dépasser et à atteindre leurs objectifs de fitness. Ce t-shirt est le choix parfait pour les personnes qui cherchent à se motiver à chaque séance d\'entraînement, et à se rappeler que chaque douleur et chaque effort est un pas vers la réussite.\r\n\r\nQue vous soyez un athlète professionnel ou un amateur passionné de fitness, le t-shirt \"No Pain No Gain\" est un choix de vêtement incontournable pour vous aider à atteindre vos objectifs de fitness. Avec son design élégant et son message inspirant, ce t-shirt vous accompagnera à chaque étape de votre parcours de fitness.', 'Griffin store T-shirt - No pain no gain - Gris', 50.00, 56.00, 60.00, 71, '665f7295df3cc.jpg', '665f7295dfc1b.jpg', '665f7295e0148.jpg', 1, '2024-03-06 12:13:48', '2024-06-04 19:01:25'),
