(35, 'Samsung Tv 55', 'Crystal UHD 55 pouces cu7000  Crystal DisplayPlongez-vous dans l\'image avec un spectre de couleurs plus large. Crystal Display propose des nuances réalistes qui permettent de distinguer même les plus petits détails.Crystal Processor 4K Découvrez des images vives et étincelantes pourvues de couleurs riches grâce à une puce spéciale qui optimise la reproduction des couleurs et les rapports de contraste et qui contrôle le HDR. Boundless Design (3 côtés)Une conception nette et élégante pour une image infiniment pure.   Un design sans limites qui établit une nouvelle norme, conçu avec un cadre fin qui met l\'image en valeur. Une télévision toujours élégante, sur son support comme sur le mur. Résolution 4KLa TV 4K UHD va au-delà du FHD ordinaire et affiche 4x plus de pixels, offrant à vos yeux les images nettes et claires qu\'ils méritent. Vivez chaque scène comme si vous y étiez vraiment.HDR High Dynamic Range élargit la gamme d\'éclairage de votre télévision, vous permettant ainsi de profiter d\'un immense spectre de couleurs et de détails, même dans les scènes les plus sombres.   Game Enhancer Jouez à une vitesse optimale avec Real Game Enhancer. L\'image sur votre écran est optimisée pour que vous ayez plus de contrôle et que la latence d\'entrée soit à peine perceptible. Profitez d\'un jeu d\'une fluidité inégalée, sans vibration ni images floues liées au mouvement.Clean cable solution Samsung Crystal UHD offre une solution pratique pour ranger soigneusement tous vos câbles TV hors de vue, directement dans son support. Vous maintenez ainsi votre intérieur bien ordonné et profitez pleinement du magnifique design de votre télévision. Avec AirPlay 2 intégré, diffusez le contenu de vos appareils Apple sur grand écran. Vous pouvez dès lors facilement lire des vidéos, de la musique, des photos et plus encore sur votre télévision Samsung UHD à partir de votre iPhone, iPad et Mac.    Smart TV avec WiFi intégré, lecteur multimédia USB / services de streaming pris en charge: Netflix, YouTube, TV en direct, Prime Video, Google Play, multimédia local et mise en miroir vidéo sur écran, etc. TV Crystal UHD 50\" - Serie 7 - TU7000   A partir de votre feuilleton préféré au grand jeu, profitez d\'une image claire hd. Chaque image est grâce à la technologie wide color enhancer dynamique et lumineux. Numérique clean view améliore votre contenu, peu importe la qualité. En analysant le signal d\'entrée et supprimant le bruit détecté à partir de la charge, il permet une image nette et claire.   Plongez dans des images aux couleurs éclatantes et des détails exceptionnels avec ce téléviseur  ,garantissent une qualité d\'image optimale et une netteté maximale , ce qui le rend idéal pour jouer à des jeux. Sa fréquence de rafraîchissement améliorée garantit une expérience de jeu plus intense ,ce téléviseur se distingue par son menu intuitif pour que vous puissiez facilement sélectionner vos contenus en appuyant sur un bouton. Les haut-parleurs  de ce téléviseur   garantissent une clarté sonore maximale et des basses très intenses. Super expérience visuelle AVEC Qualité audio  intégré, l\'audio  offre une qualité riche et claire. Nos  TV   vous aider à mieux dormir,', 'Samsung Tv 55 cu7000 + tv 32 + deux support + box android', 2100.00, 2199.00, 2200.00, 90, '65e8d8b965e23.jpg', '665f74d93ab44.jpg', '665f74d93b11a.jpg', 5, '2024-03-06 19:57:29', '2024-06-04 19:11:05'),
(36, 'Hoco Enceinte Audio - Sport HC10 - Noir', 'Type d\'article: haut-parleur Bluetooth\r\nMatériel: ABS\r\nSortie nominale: 5W x 2\r\nBluetooth: 5.1 HFP/HSP/A2DP/AVPCP\r\nGamme de fréquence: 20HZ-20KHZ\r\nSnr: -75db à-95db\r\nTemps de charge: environ 2.5h\r\nTemps de jeu: environ 2h\r\nFonction: Bluetooth/FM/carte mémoire/Aux\r\nBatterie au Lithium polymère intégrée: 800mAh\r\nEffet d\'éclairage: lumière éblouissante colorée, rouge Orange jaune vert bleu violet', 'Haut-parleur Bluetooth Portable, lumières rvb, haut-parleur sans fil', 130.00, 140.00, 150.00, 100, '665f75811c414.jpg', '665f75811cb2e.jpg', '665f75811cfee.jpg', 5, '2024-03-06 19:59:02', '2024-06-04 19:13:53'),
(37, 'Hoco Speaker', 'Haut Parleur sans fil « BS47» portable Sport\r\n La technologie fonctionne avec une large gamme d’appareils mobiles, y compris les smartphones Apple iPhone et Android. Les écouteurs sans fil de rue désignent des écouteurs Bluetooth ou des IEM qui n’ont ni cordons ni fils entre eux ni à une source audio (smartphones, lecteurs MP3, tablette, etc.).\r\nLeur principe est simple : via la fonction Bluetooth de votre téléphone portable, vous synchroniser l’audio de l’appareil sur l’enceinte.\r\nRapprochez l’enceinte du routeur sans fil. Placez en position verticale l’antenne Wi-Fi située à l’arrière. Repérez le SSID (le nom du réseau sans fil) et la clé de cryptage (WEP ou WPA), requis pour configurer un réseau Wi-Fi. La clé de cryptage limite l’accès aux périphériques du réseau.\r\nIl faut auparavant procéder à l’appariement, en détectant les périphériques Bluetooth à votre portée.\r\nL’énergie mécanique comprime l’air et convertit le mouvement en énergie sonore ou en niveau de pression acoustique (NPA). Le son se déplace dans des ondes de pression. Plus la pression de l’air change rapidement, plus la bobine mobile bouge rapidement, plus la “fréquence” du son que nous entendons est élevée.\r\nIl vous suffit de voir quel port USB est sur votre enceinte (cela peut être de l’USB 2.0, 3.0 ou de l’USB type C) et d’acheter un câble en commerce.', 'Hoco Speaker Bluetooth BS47 - Haut parleur - Hoco -Noi', 90.00, 96.00, 100.00, 78, '65e8d968880bb.jpg', '665f69fd2b7ac.jpg', '665f69fd2bce2.jpg', 5, '2024-03-06 20:00:24', '2024-06-04 18:24:45'),
(38, 'Chromacast 4K', 'Après avoir activé la fonction Miracast dans le menu de réglage du téléviseur ou du vidéoprojecteur, il suffit d\'ouvrir le menu réglage du smartphone ou de la tablette, de se rendre dans la rubrique Écran (Display) puis Écran sans fil (Wireless Display) et d\'activer la fonction.\r\n\r\nLa technologie Miracast s\'appuie sur la transmission sans fil WiFi Direct qui permet à deux appareils de communiquer directement entre eux pour partager des données via leur connexion WiFi, sans utiliser de routeur comme point d\'accès intermédiaire.', 'Chromacast 4K Miracast Chromecast TV streaming device', 40.00, 49.00, 52.00, 92, '65e8d9f28084a.jpg', '665f6a517559a.jpg', '665f6a5175caa.jpg', 5, '2024-03-06 20:02:42', '2024-06-04 18:26:09'),
(39, 'TV Box Android', 'X96Q 4k est une Box TV Android 10.0 2GO RAM 16GO ROM qui transforme Votre TV en Smart TV 4K avec un Processeur All   Winner H313 Quad-core Arm Cortex-A53 à 1,35 GHz, Multimedia WiFi 2.4G, vous pouvez votre écran de Téléphone sur Votre TV avec l\'option Screen Mirroring cast, la X96Q TV BOX dispose d\'une interface USB 2.0 haute vitesse . Il peut transférer des fichiers à la vitesse spécifiée par le périphérique de stockage et optimiser le périphérique pour réduire la consommation d\'énergie.   Boîtier TV intelligent 4K X96Q Android 10.0 X96Q Android TV Box est un lecteur multimédia intelligent et pratique pour la maison. Android 10.0 vous donne la possibilité d\'exécuter pratiquement n\'importe quelle application Android sur votre téléviseur. Le puissant processeur Allwinner H313 Quad Core ARM Cortex A53 avec la puce graphique Penta core Mali-G31 offre des performances exceptionnelles pour la lecture vidéo haute définition. vous pouvez profiter librement de tous vos films, émissions culinaires et programmes de divertissement préférés. Cela vous apportera beaucoup de plaisir et de commodité !   Caractéristiques principales du boîtier TV Android X96Q :Système d\'exploitation Android 10.0 et Allwinner H313 Il est livré avec le système d\'exploitation Android 10.0, alimenté par le processeur quadricœur Allwinner H313 hautes performances, comprenant un GPU Mali-G31.1 Go/2 Go de RAM + 8 Go/16 Go de ROM  offrent suffisamment d\'espace pour faire fonctionner rapidement l\'appareil. Prend en charge la lecture de cartes TF jusqu\'à 64 Go, il améliore également considérablement la fiabilité de votre boîtier TV.       HEVC H.265 et VP9 Le décodage matériel H.265 et VP9 peut économiser 50 % des ressources de bande passante, vous permettant de regarder le film 4K en douceur.', 'Allwinner TV Box Android 10 X96Q 2Go 16Go 4K H313 Android', 100.00, 105.00, 120.00, 199, '665f6aba28c8f.jpg', '665f6aba292d4.jpg', '665f6aba296ea.jpg', 5, '2024-03-06 20:04:03', '2024-06-04 18:27:54'),
(40, 'Box Android', 'La box Android T9 est un appareil électronique qui fonctionne sous le système d\'exploitation Android. Elle est équipée d\'un processeur puissant qui permet de lire des vidéos en haute résolution, des jeux et d\'autres applications. Elle dispose également d\'une mémoire RAM et d\'un espace de stockage interne pour stocker vos fichiers et applications préférés. La T9 est compatible avec plusieurs types de connexion, notamment le Wi-Fi, le Bluetooth et les ports Ethernet. Elle dispose également de plusieurs ports USB pour connecter des périphériques externes tels que des claviers, des souris et des disques durs. La T9 est livrée avec une télécommande qui permet de naviguer facilement dans les menus et les applications. Elle peut également être contrôlée à distance via une application mobile compatible. La box Android T9 est idéale pour regarder des vidéos en streaming, jouer à des jeux vidéo, naviguer sur Internet et exécuter des applications Android sur votre téléviseur.', 'PARTAGEZ CE PRODUIT\r\n\r\n\r\nBox Android 4K - T9 - Noir - 4GB/32GB', 269.00, 280.00, 290.00, 20, '665f6bba4d003.jpg', '665f6bba4d92b.jpg', '665f6bba4de89.jpg', 5, '2024-03-06 20:06:22', '2024-06-04 18:32:10'),
(41, 'Récepteur HD', 'Le récepteur SAMSAT HD1600 SUPER offre une expérience de divertissement immersive avec ses spécifications principales :\r\n\r\nRésolution : Profitez d\'une qualité d\'image nette et détaillée en Full HD 1080p pour une expérience visuelle optimale.\r\nConnectivité sans fil : Accédez facilement à Internet et au contenu en ligne via Wi-Fi et 3G.\r\nPrise en charge du codage vidéo H.265 : Compression efficace sans compromettre la qualité avec MultiScreen H265.\r\nApplications intégrées : Accédez à YouTube et aux services de vidéo à la demande (VOD) pour regarder vos émissions et films préférés.\r\nConnecteurs : Connectez-vous facilement à votre téléviseur ou à d\'autres périphériques HDMI grâce à 1x HDMI et connectez des périphériques externes via 2x USB 2.0.', 'Récepteur HD1600 SUPER - Garantie 1an - SAMSAT', 200.00, 259.00, 287.00, 60, '665f6c40ac96b.jpg', '665f6c40ad1c9.jpg', '665f6c40ad709.jpg', 5, '2024-03-06 20:07:30', '2024-06-04 18:34:24'),
(42, 'Android tv box', '[Android 11 : X98 mini est équipé du dernier système d\'exploitation Android 11.0, qui est compatible avec la plupart des applications Android, il fonctionne en douceur, améliore considérablement les performances et la convivialité, le fonctionnement est plus stable et peut offrir une meilleure expérience d’utilisateur.u afin que vous puissiez naviguer facilement et profiter pleinement de vos fantastiques technoloisirs.\r\n[2.4G / 5.0G Dual WiFi & USB 2.0]: Équipé de Wi-Fi 2,4GHz à l’intérieur, il prend en charge le LAN (10/100M), la connexion est plus pratique et le signal WIFI est plus stable, vous pouvez profiter d\'une meilleure expérience vidéo. Deux ports USB 2.0 permettent le boîtier de relier à votre souris et votre clavier, pour rendre votre opération plus facile.\r\n[Image de haute définition]: Prend en charge la résolution 4K Ultra HD et les films 3D，peut fournir des capacités professionnelles de traitement d\'image, vous pouvez profiter de la vidéo à ultra haute définition 4K H.265 à la maison.La TV Box Android prend en charge le papier peint personnalisé vous permet de choisir ce que vous aimez.\r\n[Mémoire de grande capacité]: Le boîtier TV a une grande capacité de 2 Go RAM& 16 Go ROM, qui peut exécuter plusieurs tâches en même temps sans geler ni mettre en mémoire tampon le système. Il vous offre une excellente expérience de divertissement à domicile.\r\n[Chipset S905W2]: Adoptez la puce Amlogic S905W2, avec une stabilité élevée et une vitesse de traitement rapide, offrant une sortie de base puissante pour le boîtier TV.\r\nSi vous avez des questions sur la télécommande du boîtier TV/l\'adaptateur secteur/la mise à jour apk, etc., veuillez nous contacter à temps via la lettre interne d\'Amazon, et nous vous fournirons une solution dans les 24 heures.', 'X mini X98 mini 4Go/64Go Android tv box', 200.00, 269.00, 280.00, 139, '665f6c92d9b7d.jpg', '665f6c92da243.jpg', '665f6c92da68f.jpg', 5, '2024-03-06 20:09:48', '2024-06-04 18:35:46'),
(44, 'Récepteur TV - Wifi', 'Récepteur Dongle TV AnyCast M4 Plus – Connectivité Sans Fil:  802.11b / g / n Décodeur Vidéo: HD 1080p Il vous aidera à connecter votre iPhone, votre téléphone Androide, votre téléphone Windows, votre ordinateur portable, votre tablette, votre iPad L’adaptateur réseau sans fil HDMI à gain élevé vous permet de connecter votre ordinateur portable ou votre ordinateur de bureau à n’importe quel réseau sans fil N de votre domicile ou de votre bureau Conneteurs: 1 x HDMI 1.4, 1 x Micro USB', 'Anycast M4 PLUS - Récepteur TV - Wifi', 40.00, 49.00, 52.00, 18, '65e8dc3507fc3.jpg', '665f6cfaf2391.jpg', '665f6cfaf2b87.jpg', 5, '2024-03-06 20:12:21', '2024-06-04 18:37:30'),
