(46, 'Puma Chaussure', 'La chaussure dynamique ULTRA 4.4 IT permet de distancer la concurrence. Conçue pour la vitesse et l’agilité, cette chaussure comporte une tige synthétique légère mais durable fusionnée à une semelle extérieure en caoutchouc non marquant pour une accélération inégalée sur toutes les surfaces intérieures. Elles sont également proposées à un prix exceptionnel.', 'Puma Chaussure de foot ULTRA 4.4 IT enfant et adolescent 106735-01 Gris', 120.00, 130.00, 140.00, 80, '665f6ddf40868.jpg', '665f6ddf40ee6.jpg', '665f6ddf41489.jpg', 6, '2024-03-09 16:39:27', '2024-06-04 18:41:19'),
(47, 'veste homme bleu', 'Notre mission est d\'habiller les gens en fonction de leurs styles et de leurs budgets et les faire se sentir bien sur la base de la mission « Tout le monde mérite d\'être bien habillé ».Et a propos Notre Boutique Être exclusif vous propose ce blouson , unie en Bleu Il à  2 poches latérales en bas. Ce produit est fabriqué en tissu 100% polyester et agréable à porter comme un coupe vent, il est déparlant. Pour l’entretien: il se lave en machine avec eau tiède et à l’envers avec les habilles de même couleur, et le repassage est à l’envers avec le mode adapté à sa résistance. Vous pouvez l’associer avec plusieurs choix et styles, il existe en plusieurs coloris et tailles. N\'hésitez pas à le commander.', 'PARTAGEZ CE PRODUIT\r\n\r\n\r\nEtre exclusif Blouson Homme- Bleu - 900020 H24 \"Nouvelle collection \"', 104.00, 120.00, 150.00, 249, '665f6f1666fa8.jpg', '665f6f1667765.jpg', '665f6f1667c0e.jpg', 1, '2024-03-21 22:11:16', '2024-06-04 18:46:30'),
(58, 'Portefeuille', 'Le porte cartes est la version moderne des portefeuilles classiques. Il est assez fin pour les poches des sacs ou se glisser parfaitement dans toutes les poches. \r\n\r\nGrâce à la coupe généreuse de son cuir, il peut abriter au moins seize cartes supplémentaires, des billets et des cartes de visite.\r\n\r\nLe mécanisme breveté vous permet d’éjecter vos cartes d’un geste simple, et de les utiliser aussitôt. L’aluminium en plus de la protection RFID il évite aussi que vos cartes se plient ou se cassent et empêche tout détournement de données, Finition Métallisée lui donne un effet brillant', 'Peut être utilisé pour contenir des cartes de visite, des cartes de crédit, des pièces de monnaie et d\'autres petites choses\r\n\r\n                                                                            Se range confortablement dans votre poche, votre sac à main ou votre sac\r\n\r\nCe porte-carte d\'identité est idéal pour offrir des cadeaux\r\nsimili cuir\r\n\r\nGardez vos cartes propres et propres et look professionnel', 28.00, 35.00, 45.00, 60, '6649db36ba702.jpg', '6649db36baef2.jpg', '6649db36bb537.jpg', 3, '2024-05-19 09:57:58', '2024-05-19 10:44:21'),
(59, 'PC Gamer', 'C Gamer / Ordinateur Gaming (Unité Centrale) -  ASUS ROG STRIX - Intel i5 11è 11400F - Nvidia GTX 1660 TI 6G - 16 Go DDR4 - 512 SSD NVMe - Win 11 - Gris - Garantie 1 an - Souris & Claviers Asus Inclus (G10CE-51140F232W) \r\n \r\n\r\nLA PUISSANCE STRIX POUR TOUS\r\n\r\nLe PC Gamer ASUS ROG Strix G10CE allie puissance et élégance au service du divertissement numérique. Avec un processeur Intel Core i5 11400F, un SSD M.2 NVMe de 512 Go une carte graphique NVIDIA GeForce GTX 1660 Ti, le PC Gamer ASUS ROG STRIX G10CE-51140F232W vous offre la puissance et la vitesse dont vous avez besoin pour jouer dans d\'excellentes conditions.\r\n\r\n \r\n\r\nFORCE ET ÉLÉGANCE\r\n\r\nLe châssis au design unique arbore des lignes épurées et aiguisées ainsi que des finitions aux accents futuristes. Bien que présentant un format compact de tout juste 27 litres, le Strix G10CE renferme en son cœur tous les composants essentiels à une expérience gaming réussie. En outre, il occupe un minimum d\'espace sur votre espace de travail !\r\nPERFORMANCES DE JEU À PRIX OPTIMISÉ\r\n\r\nLe PC Gamer ASUS ROG Strix G10CE intègre un processeur Intel Core i5 11400F ainsi qu\'une carte graphique NVIDIA GeForce GTX 1660 Ti. Ce GPU met à votre disposition les performances graphiques révolutionnaires de l\'architecture NVIDIA Ampère. Ce PC Gamer est également équipé d\'un SSD PCIexpress M.2 de 512 Go pour des jeux ultra-rapides et des temps de chargement raccourcis.\r\n \r\n\r\nECLAIRAGE AURA SYNC PERSONNALISABLE\r\n\r\nSélectionnez vos effets lumineux préférés à partir d\'un large choix de couleurs. Synchronisez facilement votre éclairage avec les périphériques compatibles Aura Sync (souris, claviers, casques, etc.) afin de donner à votre setup un look homogène qui reflète au mieux votre style !  \r\nProcesseur : Intel Core i5-11400F, up to 4.4 Ghz, 12 Mo de mémoire cache, 6 cœurs\r\nMémoire : 16 Go DDR4 3200 Mhz\r\nDisque : 512 Go SSD NVMe M.2\r\nCarte graphique : Nvidia GeForce GTX 1660 Ti, 6 Go de mémoire dédiée GDDR6\r\nConnectivité : Wifi - Bluetooth - 4x USB 3.2 Gen 1 - 2x USB 3.2 Gen 2 - VGA - DVI-D - HDMI - RJ45\r\nCompatible ASUS Aura Sync\r\nSystème d\'exploitation : Windows 11\r\nClavier ASUS + Souris ASUS Inclus\r\nCouleur : Gris\r\nGarantie : 1 an', 'Asus PC Gamer - ROG STRIX - I5 11è - GTX 1660TI 6G- 16 Go- 512SSD - Win11', 2000.00, 2449.00, 2650.00, 89, '665f5dd59d3cc.jpg', '665f5dd59d8d2.jpg', '665f5dd59dc60.jpg', 7, '2024-06-04 17:32:53', '2024-06-04 17:32:53'),
(60, 'PC Portable', 'Des performances sur mesure\r\nL’IdeaPad 3 (15\",N4020) est un portable d’entrée de gamme suffisamment puissant pour répondre à toutes vos attentes. Un processeur mobile jusqu’à  INTEL N4020 et un circuit graphique indépendant INTEL N4020™ facilitent le multitâche, boostent la vitesse de ses performances et offrent une expérience de divertissement exceptionnelle. Sa conception bien pensée, avec des détails tels que le cache physique de sécurité intégré à la webcam, en fait le compagnon idéal de votre quotidien.\r\nPlus pour moins cher\r\nNe vous fiez pas à son prix : pour un portable conçu pour un usage quotidien, l’IdeaPad 3 (15\",  INTEL N4020) vous offre beaucoup plus ! Avec son processeur mobile jusqu’à  INTEL N4020, dopé par de puissantes options de mémoire, de stockage et de circuit graphique, cet appareil va au-delà de vos attentes. En outre, que vous travailliez sur le budget familial ou prépariez une feuille de calcul, le clavier numérique s’avèrera bien pratique et boostera votre productivité.', 'Lenovo PC Portable IP1 N4020 15.6\" / 8GO /256SSD Bleu Garantie 2ans + Sacoche original t210', 700.00, 780.00, 800.00, 80, '665f5e9799d04.jpg', '665f5e979a1a8.jpg', '665f5e979a535.jpg', 7, '2024-06-04 17:36:07', '2024-06-04 17:36:07');
INSERT INTO `products` (`id`, `name`, `description`, `details`, `purchase_price`, `price`, `old_price`, `qte`, `photo`, `imag_one`, `imag_two`, `category_id`, `created_at`, `updated_at`) VALUES
(61, 'Lenovo PC Portable', 'PC Portable - Lenovo V15-IML G4 - AMD 7120U - 8G DDR5 Soudés - 256 SSD M.2 NVMe - 15,6\" FHD (82YU0044FE)   + Sacoche Offerte   \r\nRobuste et mobile\r\n\r\nL\'ordinateur portable Lenovo V15-IML G4 est conçu pour être à la fois robuste et puissant, afin que vous puissiez faire le travail. Avec sa conception robuste et son écran à cadre mince, il trouve le juste équilibre entre confort et mobilité. L\'ordinateur portable Lenovo V15 G4 offre performances et rapidité avec son processeur AMD Athlon Silver 7120U , 8 Go de mémoire DDR5 et 256 Go PCIexpress M.2 SSD .  \r\nÉCRAN 15,6\" AVEC CADRE FIN\r\n\r\nAvec un écran à cadre mince de 15,6 pouces et une résolution Full HD 1080p, l\'ordinateur portable Lenovo V15 G4 vous offre l\'expérience visuelle dont vous avez besoin pour travailler confortablement et profiter du divertissement multimédia.  \r\nCONCEPTION ROBUSTE\r\n\r\nLenovo a testé la fiabilité et la robustesse de cet ordinateur portable dans des conditions extrêmes dans huit catégories : chocs, vibrations, clavier, durée de vie des charnières, fiabilité du ventilateur, résistance aux rayures de l\'écran, température et pression de fonctionnement. Il est donc prêt à affronter toutes les conditions que votre vie professionnelle trépidante peut lui imposer.  \r\nEcran: 15.6\" Full-HD / Dalle TN / 60Hz\r\nProcesseur: AMD Athlon Silver 7120u (2 Coeurs / de 2.4Ghz à 3.5Ghz / 1MB Cache L2 / 2MB L3)\r\nMémoire RAM: 8GB soldered LPDDR5-4800\r\nDisque dur : 256GB SSD NVMe 4.0 M.2 2242\r\nCarte graphique: AMD Radeon 610M\r\nConnectivité : 1xEthernet(RJ-45), 1xHDMI 1.4b, 1xHeadphone/microphone combo Jack(3.5mm), 1xpoer Connector, 1xUSB-C Gen1, 2xUSB3.2 Gen1\r\nCaméra : HD 720p Avec Privacy Shutter\r\nSystème d\'exploitation: FreeDos\r\nCouleur: Noir\r\nPoids: 1,65 Kg\r\nGarantie: 1 an\r\n+ Sacoche Lenovo T210 Offerte', 'Lenovo PC Portable - V15-IML G4 - AMD 7120U - 8G DDR5 256SSD 15,6\" FHD + Sacoche Offerte', 800.00, 835.00, 890.00, 60, '665f5f40429ce.jpg', '665f5f4042ec4.jpg', '665f5f40432a0.jpg', 7, '2024-06-04 17:38:56', '2024-06-04 17:38:56'),
(62, 'Clavier pc', 'Clavier Flexible 5V-250MA : Clavier AZERTY - Souple et étanche - Idéal pour les déplacements - Rangement facile - Lavable à l\'eau - Interface USB - Couleur : Noir\r\nClavier flexible, pratique à transporter, étanche, lavable, résistantr, le rouler et le glisser dans votre sac très facilement Ce clavier est parfait pour une utilisation dans un environnement poudreux et humide Surface concave, frappe très agréable Un clavier est parfois accompagné de pédales, de la même manière que peut l’être le clavier d’un instrument de musique. Afin d\'assurer une certaine familiarité des usagers avec les différents modèles de clavier, ceux-ci sont l’objet de plusieurs normes1. La technique de frappe au clavier se nomme dactylographie. Pour une meilleure efficacité, un dactylographe vise à utiliser tous ses doigts.', 'Clavier pc portatif flexible USB', 15.00, 20.00, 25.00, 80, '665f5fd72c8af.jpg', '665f5fd72ce98.jpg', '665f5fd72d2bf.jpg', 7, '2024-06-04 17:41:27', '2024-06-04 17:41:27'),
(63, 'Clavier Bluetooth', 'Mini Clavier Bluetooth pour Smart TV et autres appareil Android, Ce mini clavier comprend toutes les touches d\'un clavier classique avec en plus celles d\'une télécommande (play, pause, mute, etc..) et des raccourcis très pratique (home, searching, etc\').,2,4 GHz clavier multimédia tactile sans fil à main Libre, il est adapté pour Smart TV, téléphone intelligent /PC/TV box/laptop. USB récepteur, aucun pilote nécessaire.. Multifonction ce Mini clavier sans fil 2,4 GHz, combo TouchPad, avec adaptateur d\'interface USB. Touchpad qui prend en charge les fonctions multi-doigts, un clic avec un doigt en tant que fonction de la souris gauche, un clic avec deux doigts en tant que fonction de la souris droite, le double doigt glisser comme écran déroulant. Batterie au lithium rechargeable intégrée! Conception de la poignée de jeu: Le mini clavier sans fil Android est conçu comme une poignée pour le joueur de jeu. Il y a 2 polorus ronds sur les côtés droit et gauche du clavier. En même temps, il ressemble également à un véritable clavier pour PC ou ordinateur portable', 'Mini Clavier Bluetooth pour Android - Noir', 22.00, 29.00, 32.00, 45, '665f60591417f.jpg', '665f605914643.jpg', '665f605914987.jpg', 7, '2024-06-04 17:43:37', '2024-06-04 17:43:37'),
(64, 'Imprimante hp', 'Conçu pour l\'impression de gros volumes\r\n\r\nObtenez jusqu’à 18 000 pages en noir et blanc ou 8 000 pages en couleur d’encre HP authentique incluses dans la boîte.\r\n\r\n \r\nAugmentez votre productivité à la maison\r\n\r\nGagnez du temps et augmentez votre productivité grâce à une impression de haute qualité, au recto-verso et à l’appli HP Smart.\r\n\r\n \r\nImpression recto-verso automatique\r\n\r\nEnchaînez rapidement plusieurs pages de document grâce à une impression recto-verso automatique.\r\n\r\n \r\nDes économies de taille\r\n\r\nParfait pour les volumes d’impression à faible coût, avec jusqu’à trois ans d’encre HP authentique inclus dans la boîte.\r\n\r\n \r\nLa fiabilité de votre connexion\r\n\r\nProfitez de connexions plus rapides et plus fiables grâce au Wi-Fi bibande avec réparation automatique.\r\n\r\n \r\nImpression respectueuse de l’environnement / Conçu pour l\'impression de gros volumes', 'PARTAGEZ CE PRODUIT\r\n\r\n\r\nHp Smart Tank 670 - Imprimante All-in-One - 3en1 - Wifi - Recto-Verso Automatique - 22PPM - à réservoir', 650.00, 739.00, 780.00, 50, '665f67c887b82.jpg', '665f67c887fcb.jpg', '665f67c888311.jpg', 7, '2024-06-04 18:15:20', '2024-06-04 18:15:20'),
(65, 'informatique Epson', 'Flexibilité moderne ,intégrez facilement cette imprimante à votre configuration domestique existante et imprimez à partir de mobiles, de tablettes et d\'ordinateurs portables 4 . De plus, avec l\'application Epson Smart Panel, vous pouvez contrôler votre imprimante depuis votre appareil intelligent 4 . Imprimez des documents et des photos, configurez, surveillez et dépannez depuis votre téléphone ou votre tablette.\r\n\r\nEmballé avec des fonctionnalités , doté d\'un écran LCD couleur de 3,7 cm, d\'une impression recto verso automatique, d\'une impression photo sans marge et de vitesses d\'impression allant jusqu\'à 10,5 pages par minute 5 , vous pouvez accélérer facilement une variété de tâches.\r\n\r\nImpression, copie et scan\r\nLivrée avec encre noire jusqu\'à 14000 pages et 5200 pages en couleur\r\nVitesse d\'impression noir: 33 pages/min (10,5 pages/min en norme ISO)\r\nVitesse d\'impression couleur: 15 pages/min (5 pages/min en norme ISO)\r\nImpression recto/verso: Automatique\r\nFonctionne avec: 4 Cartouches (noir, cyan, magenta, jaune)\r\nConnectivité: 1 port USB 2.0, Wi-Fi, Wi-Fi Direct\r\nApplication Smart Panel', 'Epson Imprimante EcoTank L4260 à réservoirs rechargeables Wi-Fi', 700.00, 799.00, 820.00, 45, '665f68e0edb54.jpg', '665f68e0ee048.jpg', '665f68e0ee40c.jpg', 7, '2024-06-04 18:20:00', '2024-06-04 18:20:00'),
(66, 'Hp Imprimante multifonction', 'Cette imprimante sans cartouche assure une qualité sans compromis et offre jusqu\'à 3 ans de cartouches d\'encre inclus dans la boîte. Bénéficiez de connexions plus rapides avec le Wi-Fi double bande, et de l\'impression mobile facile avec l\'application HP Smart.\r\n\r\n\r\n\r\n\r\nGrands volumes d\'impression à faible coût et conception innovante\r\n\r\nImprimez jusqu\'à 18 000 pages en noir et blanc ou jusqu\'à 8 000 pages en couleur.\r\n\r\nSurveillez et maintenez facilement les niveaux d\'encre avec une conception de réservoir intégré et un capteur d\'encre automatique.\r\n\r\nRechargez facilement votre réservoir d’encre avec des bouteilles sans éclaboussures et refermables.\r\n\r\nObtenez les fonctionnalités dont vous avez besoin pour le travail et d\'autres tâches grâce aux fonctionnalités de copie et de numérisation.\r\n\r\n\r\n\r\nUne technologie de pointe pour la meilleure qualité d\'impression de sa catégorie\r\nVous pouvez compter sur du texte net et sombre et sur des graphismes aux couleurs vives pour toutes vos impressions.\r\n\r\nImprimez des photos qui résistent à la décoloration et qui durent.\r\n\r\nCréez des brochures, des dépliants, des photos sans bordures, ainsi que d\'autres documents qui ont fière allure, directement dans votre bureau.\r\n\r\n\r\n\r\nDes connexions rapides, une productivité en toute simplicité\r\n\r\nBénéficiez de connexions plus rapides, plus fiables avec le Wi-Fi® double bande.\r\n\r\nFaites disparaître les étapes des tâches répétitives avec des raccourcis personnalisables Smart Tasks.\r\n\r\nDécouvrez la liberté de travailler quasiment partout avec l\'application HP Smart, imprimez, numérisez et copiez depuis votre téléphone.\r\nBénéficiez de vitesses jusqu\'à 38 % plus rapides par rapport au modèle HP Smart Tank précédent.', 'PARTAGEZ CE PRODUIT\r\n\r\n\r\nHp Imprimante multifonction - SMART TANK 515 - Wifi - 3en1 - Garantie 1an', 520.00, 578.00, 600.00, 80, '665f697e0b5bf.jpg', '665f697e0bae6.jpg', '665f697e0bea7.jpg', 7, '2024-06-04 18:22:38', '2024-06-04 18:22:38'),
(67, 'Baskets Enfants', 'Baskets Enfants LC 101 Beige Kaki - Similicuir - Scratch -\r\nLes enfants ont besoin de bonnes chaussures, Styles, élégantes et surtout confortables ! La nouvelle collection  de LC shoes+ propose des sneakers pour enfants fabriqués en Tunsie  de différentes couleurs  s\'adaptent à tous les styles d\'habillements, ces baskets   sont dotées  d\'une semelle intérieure synthétique TR souple et légère  de hauteur de talon 3 cm et de hauteur de plateau de 2 cm , tige de bonne qualité de  simili cuir  et doublure textile lisse afin de garder les pieds au sec et ainsi d\'empêcher les odeurs  . Il a double  fermeture à lacets et scratch qui s\'adapte parfaitement au pied de l\'enfant en pleine croissance. La semelle extérieure  offre une bonne traction et une excellente durabilité.Leur désign simple  et Nubuck  ce qui en fait une chaussure idéale pour les activités intérieures ou extérieures. Ces baskets sont un choix polyvalent et pratique pour les enfants actifs.', 'Icshoes+ Baskets Enfants LC 101 Beige Kaki - Simlicuir - Scratch -', 52.00, 50.00, 74.00, 58, '665f6ffd1b189.jpg', '665f6ffd1b739.jpg', '665f6ffd1bb77.jpg', 6, '2024-06-04 18:50:21', '2024-06-04 18:50:21'),
(68, 'Nike Basket', 'La marque a assuré sa notoriété par un logo simple et rapidement reconnaissable : le Swoosh, une virgule posée à l\'envers et à l\'horizontale ; il a été créé par Carolyn Davidson en 1971 comme une représentation stylisée de l\'aile de la déesse.\r\n\r\nEn 2005, Nike réalise 55 % de ses ventes à l\'étranger6. L\'entreprise est actuellement le plus grand équipementier sportif dans le monde avec un chiffre d\'affaires de 32,4 milliards de dollars, devant Adidas qui fut le leader incontesté pendant 50 ans7.', 'Nike Basket Pico 5 (Psv) - AR4161-600', 45.00, 60.00, 78.00, 20, '665f70a9415c2.jpg', '665f70a941ae3.jpg', '665f70a942050.jpg', 6, '2024-06-04 18:53:13', '2024-06-04 18:53:13'),
(69, 'Presse orange', 'Découvrez la révolution du petit-déjeuner avec le Presse-Agrumes Électrique Sokany, présenté par la boutique Kitchina sur Jumia. Cet appareil innovant allie design élégant et performances exceptionnelles pour transformer votre routine matinale en une expérience délicieuse et énergisante.Avec des dimensions d\'environ 17,7 * 28 cm, le presse-agrumes Sokany offre une compacité idéale pour s\'adapter à votre cuisine sans encombrer votre espace. Équipé d\'une prise UE, il est spécialement conçu pour une utilisation dans l\'Union européenne, répondant ainsi aux normes de sécurité et de qualité les plus strictes.Fonctionnant à une fréquence nominale de 50/60 Hz, le presse-agrumes Sokany s\'adapte facilement à différents systèmes électriques, assurant une polyvalence d\'utilisation. Sa tension nominale de 220 V en fait un choix optimal pour les foyers européens, assurant une performance fiable à chaque utilisation.Avec une puissance nominale de 45 W, cet appareil économe en énergie offre des résultats exceptionnels. Son réservoir d\'une capacité généreuse de 700 ml vous permet de presser vos agrumes préférés sans interruption, offrant une expérience de jus de fruits fraîchement pressé à chaque fois.Le Presse-Agrumes Sokany allie esthétique et fonctionnalité, créant un équilibre parfait entre design moderne et efficacité. Profitez de jus d\'agrumes frais et vitaminés sans tracas, grâce à cet appareil intuitif et facile à utiliser.\r\nCet appareil versatile est idéal pour tous les amateurs de jus de fruits, des petits-déjeuners revigorants aux soirées détendues. Offrez-vous un réveil dynamique avec le Presse-Agrumes Électrique Sokany, une exclusivité de la boutique Kitchina sur Jumia, pour une expérience de petit-déjeuner exceptionnelle au quotidien. Transformez votre routine matinale avec Sokany et savourez chaque gorgée de fraîcheur.Les caractéristiques électriques du Presse-Agrumes Électrique Sokany sont parfaitement adaptées à une utilisation dans l\'Union européenne. La prise européenne, standard dans de nombreux pays du continent, assure une compatibilité directe avec les systèmes électriques locaux. La fréquence nominale de 50 ou 60 Hertz permet une flexibilité d\'utilisation, s\'harmonisant avec les diverses fréquences présentes en Europe.', 'Sokany Presse orange électrique professionnel - JE-623D - 45W - 700 ml -Garantie 1 an', 50.00, 63.00, 72.00, 140, '665f76e76dfc1.jpg', '665f76e76e73d.jpg', '665f76e76ed96.jpg', 4, '2024-06-04 19:19:51', '2024-06-04 19:19:51'),
(71, 'Biolux Réfrigérateur', 'Ce réfrigérateur-congélateur posable Biolux présente les caractéristiques suivantes : couleur Inox. Technologie réduisant efficacement le taux d’humidité présent à l’intérieur du congélateur et empêchant ainsi l’accumulation de givre afin de prolonger la fraîcheur optimale de vos aliments En régulant indépendamment chaque cavité sans circulation d\'air entre les deux. Appareil de grande taille pour répondre aux besoins de toute la famille. Étagères en verre élégantes et robustes. Grande capacité et modularité.', 'Biolux Réfrigérateur - SIDE BY SIDE - SS 61 X - 610 L - NF - Inox - Garantie 1 an', 2900.00, 3000.00, 3100.00, 20, '665f782cab7cc.jpg', '665f782cabca5.jpg', '665f782cac06a.jpg', 4, '2024-06-04 19:25:16', '2024-06-04 19:25:16');
